import "./index.css";

const apiKey = "J0BuX1MIuj3hEY2ESEJuiPH5iXCdpLkY";

const peticionAPI = fetch(`api.giphy.com/v1/gifs/random?api_key${apiKey}`);

peticionAPI
  .then((respuesta) => console.log(respuesta.json()))
  .then((data) => {
    console.log(data);
  });
